    return(
        <div className='Account'>
            <Header/>
            <div className='Account-block'>
                <div className='Account-nav'>
                    <button></button>
                    <button></button>
                    <button></button>

                </div>
                <div className='Account-inf'>

                </div>
            </div>
            <Footer/>
        </div>
    )
}
export default Account;
